const Awards = (props) => {
    //Award generation
    var awardArray = props.awards.split(',');
    var awards = [];
    for (var i=0; i<awardArray.length; i++){
        var pointsArray = awardArray[i].split('-');
        awards.push(<p><b>{pointsArray[0]}</b></p>);
        for (var j=0; j<pointsArray.length; j++){
            if (j!=0){
                awards.push(<p style={{paddingLeft:'32px'}}>{pointsArray[j]}</p>);
            }
        }
    }

    return (
    <div className="row bound">
    {awards}
    </div>
    )
}

export default Awards
